import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the main content to be loaded by waiting for the "category-card" for Electronics
    await page.waitForSelector('.category-card', { timeout: 5000 });

    // Find the Electronics category card by its text content (using XPath for uniqueness)
    const [electronicsCard] = await page.$x("//div[contains(@class,'category-card')][contains(.,'Electronics')]");
    if (!electronicsCard) {
      throw new Error('Electronics category card not found');
    }

    // Take screenshot before clicking
    const beforeClickShot = path.join(screenshotsDir, 'step_2_before_click_electronics.png');
    await page.screenshot({ path: beforeClickShot });
    screenshots.push(beforeClickShot);

    // Click the Electronics category card
    await electronicsCard.click();

    // Wait for the category results to load by checking for the heading with "Electronics"
    await page.waitForSelector('h2', { timeout: 5000 });
    const headings = await page.$$eval('h2', els => els.map(e => e.textContent));
    const foundElectronicsHeading = headings.some(h => h.toLowerCase().includes('electronics'));

    // Take screenshot after navigation
    const afterClickShot = path.join(screenshotsDir, 'step_3_after_click_electronics.png');
    await page.screenshot({ path: afterClickShot });
    screenshots.push(afterClickShot);

    // Extract product titles under Electronics (first 5)
    const productTitles = await page.$$eval('.product-title', els =>
      els.slice(0, 5).map(e => e.textContent.trim())
    );

    return {
      success: foundElectronicsHeading,
      action: "Navigated to Electronics category and verified category page loaded",
      extractedData: {
        electronicsHeadingFound: foundElectronicsHeading,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
